package app.groceryapp.data.model.api.response.category;import com.google.gson.annotations.Expose;import com.google.gson.annotations.SerializedName;public class SubSubCategory {    @SerializedName("sub_sub_category_id")    @Expose    private Integer subSubCategoryId;    @SerializedName("category_id")    @Expose    private Integer categoryId;    @SerializedName("sub_category_id")    @Expose    private Integer subCategoryId;    @SerializedName("sub_sub_category_name")    @Expose    private String subSubCategoryName;    @SerializedName("is_active")    @Expose    private Integer isActive;    public Integer getSubSubCategoryId() {        return subSubCategoryId;    }    public void setSubSubCategoryId(Integer subSubCategoryId) {        this.subSubCategoryId = subSubCategoryId;    }    public Integer getCategoryId() {        return categoryId;    }    public void setCategoryId(Integer categoryId) {        this.categoryId = categoryId;    }    public Integer getSubCategoryId() {        return subCategoryId;    }    public void setSubCategoryId(Integer subCategoryId) {        this.subCategoryId = subCategoryId;    }    public String getSubSubCategoryName() {        return subSubCategoryName;    }    public void setSubSubCategoryName(String subSubCategoryName) {        this.subSubCategoryName = subSubCategoryName;    }    public Integer getIsActive() {        return isActive;    }    public void setIsActive(Integer isActive) {        this.isActive = isActive;    }}